import React from 'react';
import '../Styles/header_styles.css';
// This file represents the header section of the web page 
// which will always be present. We must alter the header based on 
// the condition of them being signed in as a registered customer or not
const Header = () => {
    return (
        <div>
            <div>Morisette</div>
            <ul id='navBar'>
                <li className="listElem">Home</li>
                <li className="listElem" >Browse</li>
                <li className="listElem" >Cart</li>
                <li className="listElem" >Account Settings</li>
                <li className="listElem" >Sign in</li>
            </ul>
        </div>
    )
}

export default Header;
